"use strict";App.Router.map(function(){"#/",this.resource("login");this.resource("manager")});App.UserRoute=Ember.Route.extend({model:function(){return this.store.find("user")}});App.AlianceRoute=Ember.Route.extend({model:function(){return this.store.find("aliance")}});App.IndexRoute=App.UserRoute.extend({beforeModel:function(e){this.transitionTo("login")}});App.LoginRoute=App.UserRoute.extend({templateName:"login"});App.ManagerRoute=App.AlianceRoute.extend({templateName:"manager",afterModel:function(e){this.controllerFor("login").get("userLogged")==""&&this.transitionTo("login");var t=this.controllerFor("manager");t.set("loggedUser",this.controllerFor("login").get("userLogged"))}});